import React from 'react';
import Tribe from './assets/Tribe.png'
import Container from '@mui/material/Container'
import Grid from '@mui/material/Grid';
import Link from '@mui/material/Link';
import Button from '@mui/material/Button';


const Index = () => {
  return( 
    <>  
        <Container>
            <Grid container sm={12} style={{marginTop: 20}} >
                <Grid item sm={4}  container justifyContent='center'><img src={Tribe} alt='tribe' /></Grid>
                <Grid item sm={4} container justifyContent='center'><Button variant='outlined'>Assignment 1</Button></Grid>
                <Grid item sm={4} container justifyContent='center'><Button variant='outlined' size='small'>Assignment 2</Button></Grid>
            </Grid>
        </Container>
    </>
    )
};

export default Index;
